spice.body:
**** CohenHelie triode fitted in ValveWorkbench
**** Subcircuit generated from fitted model parameters.
**** Node order: P=plate, G=grid, K=cathode, H=heater (unused).

.subckt AS_6N2P_EV_AS P G K H
+ + MU=103.577819282 KG1=0.670010517383 KP=370.688376065 KVB=0 KVB1=37.0809157147 VCT=0.0768192677963 X=1.42514575988

* Va = V(P,K), Vgk = V(G,K) (negative for normal bias)
* Epk helper as in CohenHelieTriode::cohenHelieEpk
.func CH_f(v)    { sqrt( max( 0, KVB + KVB1*v + v*v ) ) }
.func CH_y(v,vg) { KP * ( 1/MU + (vg + VCT)/(CH_f(v) + 1e-9) ) }
.func CH_ep(v,vg){ v/KP * ln( 1 + exp( limit(CH_y(v,vg), -50, 50) ) ) }
.func CH_ia(v,vg){ ( max( CH_ep(v,vg), 0 )**X ) / max(KG1,1e-9) }

* Behavioural anode current source from P to K.
* The max() guard mirrors the C++ clamp that prevents negative Ia near Va0.
Biak P K I = { max( CH_ia( V(P,K), V(G,K) ), 0 ) }

.ends AS_6N2P_EV_AS
